   this[database_length++] = new SearchPage("index.php", "RynnaWebOS", "Rynna WebOS utilise un moteur PHP 7  appelé noyau PHP  pour fonctionner. Le WebOS est codé en différents langages   PHP, CSS, Javascript, JQuery et utilise des applications et outils développés majoritairement en Java, Flash Player, Ajax et ASPX pour les applications virtualisées.  Rynna WebOS a été conçu par 13 développeurs depuis Mars 2015 à l'aide des logiciels suivants   Notepad++  gratuit , Wysiwyg Web Builder  payant , Paint.NET  gratuit , Visual Studio ASP.NET  gratuit , OpenElement  gratuit  et Blisk  gratuit .  Le code source complet de Rynna WebOS est disponible ici même    Informations sur le WebOS  Afficher les bugs recensés  Version 50.0  Release  Desktop Virtual Manager  DVM  PHP 7, CSS 3, JQuery 3.3.1  OUPS !  Il semblerais que le WebOS ne soit pas compatible avec votre navigateur Web actuel ou que votre navigateur internet actuel a un problème...  Pour remédier à cela nous vous conseillons d'utiliser les navigateurs suivants     - Mozilla Firefox - Google Chrome - Internet Explorer - Microsoft Edge - Opéra  Néon   et de vous assurer que ceux-ci sont à jour pour pouvoir supporter une interface internet dynamique  JQuery/PHP/CSS 3 .  Vous pouvez aussi essayer de vider le Cache de votre navigateur internet actuel.  Si le problème persiste   contactez l'administrateur du serveur sur support@rynnawebos.fr pour plus d'information.  Navigateurs internet les plus performants, fiables et fluides pour utiliser le WebOS correctement  passer votre souris sur les barres pour recevoir plus d'informations     Mozilla Firefox  Google Chrome  Internet Explorer  Microsoft Edge  Maxthon 5  Néon  Opéra  Safari  De quoi cela parle t-il ?  Jquery est un langage Web avancé permettant l'affichage des fenêtres du WebOS et des divers boutons et options visuelles, y compris l'animation des images et la gestion interne du WebOS.  Flash est un langage d'animation pour divers médias. Plusieurs logiciels basiques ou avancés sont conçus en Flash et peuvent être lancés dans le WebOS.  Javascript est un langage de scripting   il permet d'effectuer toutes les actions internes du WebOS  appels des sites par redirections automatiques lors d'un clic sur un contrôle par exemple . C'est une fonction indispensable au WebOS.  Les Fonctions JS  javascript  d'appels permettent de créer les liaisons entre le clic sur un objet  action  vers les balises qui se trouvent dans la pluspart des applications du WebOS. Sans cette fonction vous serez obligé de cliquer manuellement sur \"Charger/Actualiser\" sur certains programmes pour forcer leurs affichages !  La fluidité du WebOS est calculée sur le déplacement des fenêtres à l'écran, des animations JS/JQuery mais aussi du multi-tâches supportés par votre navigateur. Plus la fluidité est bonne plus vous pourrez afficher rapidement vos programmes.  La stabilité du WebOS est basé sur la navigateur internet qui le supporte. Le WebOS est conçu pour s'adapter au maximum des navigateurs existants mais certains peuvent ne pas supporter certains scripts et ainsi ralentir ou bloquer  provoquant des crashs  lors votre utilisation du WebOS.  Oublie du mot de passe ?  Informations sur les Cookies  Cookies information  Les cookies sont de petits fichiers texte qui sont placés sur votre ordinateur par les sites web que vous visitez. Ils sont largement utilisés afin de permettre le fonctionnement des sites ou de rendre leur fonctionnement plus efficace, et de fournir des informations à leur propriétaire. L'utilisation de cookies est aujourd’hui la norme pour la plupart des sites. Vous pouvez gérer et contrôler les cookies en utilisant votre navigateur. Vous pouvez également les supprimer dans votre navigateur lorsque vous quittez le site. Gestion des cookies  Pour la gestion des Cookies et de vos choix, la configuration de chaque navigateur est différente. Elle est décrite dans le menu d'aide de votre navigateur, qui vous permettra de savoir de quelle manière modifier vos souhaits en matière de Cookies.  Types de cookies       - « Cookies de Session » restent stockés dans votre navigateur seulement durant votre session de navigation c'est à dire jusqu'à ce que vous quittiez le site.     - « Cookies Persistants » restent dans votre navigateur après la session  sauf si vous les avez supprimés .     - « Cookies de Performance » collectent des informations sur votre utilisation du site, comme les pages web visitées et les messages d'erreur, ils ne recueillent pas de renseignements concernant des personnes identifiées, et les informations collectées sont agrégées de sorte qu’elles sont rendues anonymes. Les cookies de performance sont utilisés pour améliorer la façon dont fonctionne un site web.     - « Cookies de Fonctionnalité » permettent au site de se rappeler les choix que vous faites sur le site web  tels que des modifications de la taille du texte, des pages personnalisées  ou activer des services tels que des commentaires sur un blog.  Un problème de connexion ? Un compte qui ne répond plus ? Vous pensez que quelqu'un d'autre que vous a accès à votre session ? Une erreur d'affichage ? Une autre question ? Envoyer à notre équipe un e-mail pour être rapidement dépanné !  Nom de compte    Mot de passe     ", "");
